        <ListGroup.Item action>Rectangle</ListGroup.Item>
        <ListGroup.Item action> Circle</ListGroup.Item>
        <ListGroup.Item action>Vector</ListGroup.Item>
      </ListGroup>
    </Col>
    {/* khung làm việc */}
    <Col xs={8} className='d-flex align-items-center justify-content-center '>

    </Col>
    {/* thanh thuộc tính */}
    <Col xs={2} className='border-left'>
    </Col>
  </Row>
</Container>
  );
}

